    salinity and other variables collected from time series observations using Bubble
    type equilibrator for autonomous carbon dioxide (CO2) measurement, Carbon dioxide
    (CO2) gas analyzer and other instruments from the MOORINGS in the South Pacific
    Ocean from 2004-05-08 to 2010-11-06 (NODC Accession 0100076)",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-29T01:37:21.619964",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time9ed2d",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0100076 includes chemical,
    physical and time series data collected from MOORINGS in the South Pacific Ocean
    from 2004-05-08 to 2010-11-06. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
    (OR FUGACITY) OF CARBON DIOXIDE, CARBON DIOXIDE - AIR, OXYGEN - PERCENT SATURATION,
    Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE.
    The instruments used to collect these data include Bubble type equilibrator for
    autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
    data were collected by Christopher Sabine, Adrienne Sutton and Stacy Maenner of
    US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring_TAO125W
    data set. CDIAC assigned the following cruise ID(s) to this data set: TAO_20040508.nnThe
    Global CO2 Time-series and Moorings Project involves international groups from 18
    countries who have mounted sensors on moored buoys to provide high resolution time-series
    measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
    (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
    Ocean Carbon Coordination Project (IOCCP).",nt"license_title": null,nt"extras":
